import React from "react";
import styled from "styled-components";
import StyledTriangle from "./Triangles";

const ScatterWrapper = styled.div`
    display: flex;
    flex-flow: row wrap;
    flex-wrap: wrap;
    position: absolute;
    height: 50%;
    width: 50%;
    bottom: 0;
    background-color: beige;
`;

const HalfSizeTriangle = styled(StyledTriangle)`
    width: 50%;
    position: unset;
`;

const Scatter = (props) => {
    return (
        <ScatterWrapper>
            <HalfSizeTriangle src={props.TriangleSource} />
            <HalfSizeTriangle src={props.TriangleSource} />
            <HalfSizeTriangle src={props.TriangleSource} />
            <HalfSizeTriangle src={props.TriangleSource} />
        </ScatterWrapper>
    )
}

export {Scatter};
